import React from 'react';

function Nav() {


    return(
        <header>
            <h2>
                <a href='/'>
                    <span> JCV </span>
                </a>
            </h2>

            <nav>
                <ul className='flew-row'>
                    <li className='mx-2'> <a href='/'>About</a> </li>
                    <li className='mx-2'> <a href='/'>Projects</a> </li>
                    <li> <a href='/'>Contact</a> </li>
                    <li> <a href='/'>Resume</a> </li>
                </ul>
            </nav>

        </header>
    );
}



export default Nav;
